import './content.css'
import HeaderBar from './headerbar'
import ChatContent from './ChatContent/chatcontent';

function Content({ selectedCategory }) {
    // console.log(selectedCategory);
    switch (selectedCategory) {
        case 1:
            return (<div className="content">
                <HeaderBar />
                /</div>);
                case 2:
                <ChatContent />
                break;
                case 3:
                <ChatContent />
                break;
                case 4:
                <ChatContent />
                break;
                case 5:
                <ChatContent />
                break;
                case 6:
                <ChatContent />
                break;
                default:
                <ChatContent />
                break;
    }
                return (
                <div className="content">
                    <HeaderBar />
                    {(() => {
                        switch (selectedCategory) {
                            case 1:
                                <ChatContent />
                                break;
                            case 2:
                                <ChatContent />
                                break;
                            case 3:
                                <ChatContent />
                                break;
                            case 4:
                                <ChatContent />
                                break;
                            case 5:
                                <ChatContent />
                                break;
                            case 6:
                                <ChatContent />
                                break;
                            default:
                                <ChatContent />
                                break;
                        }
                    })}
                </div>
                );
}

                export default Content;
